import {useState} from 'react'

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Header from './Header';
import Login from './Login';


function App() {
  return (
    <Router>
      <div className="app">
        <Switch>

          <Route path="/dashboard">
          <Header />
          </Route>

          <Route path="/">
            <Login />
          </Route>

        </Switch>

      </div>
    </Router>
  );
}

export default App;
